package twoPointers.slideWindow.L0076_最小覆盖字串;

import java.util.HashMap;

public class Solution {
    public static void main(String[] args) {
        String s= "";
        String s1 = "";
        String s2 = "" ;
        String t = "";
        System.out.println(s.length());
        System.out.println(s1.length());
        System.out.println(s2.length());
        System.out.println(t.length());
        String res = minWindow(s, t);
        System.out.println("res = " + res);
    }
    public static String minWindow(String s, String t) {
        HashMap<Character, Integer> need = new HashMap<>();
        HashMap<Character, Integer> window = new HashMap<>();
        int valid = 0;
        int left = 0, right = 0; //左闭右开[0,1)
        int len = Integer.MAX_VALUE;
        int start = 0;
        for(char c : t.toCharArray()){
            need.put(c , need.getOrDefault(c, 0) + 1);
        }
        //right不断右移
        while(right < s.length()){
            char c = s.charAt(right);
            right++;
            if(need.containsKey(c)){
                window.put(c, window.getOrDefault(c, 0) + 1);
                // 这个判断要放在里面，因为如果c不是目标字符，两个map里都不存在，则也会进去，这是不对的
                /***
                 * java中的包装类型Integer缓存了-128~127之间的包装对象，如果在这个范围类因为是同一个对象所以==和equals效果一致，过了这个范围就只能equals
                 * ***/
                if(window.get(c).equals(need.get(c))){ //原本用==，但一串超长字符串测试失败，改成equals即可，为什么？
                    //对于字符c， 窗口中和目标字符串中的该字符，个数一样了，valid+1
                    valid++;
                }
            }

            /*** debug 输出的位置 ***/
            //printf("window: [%d, %d)\n", left, right);
            //System.out.println("window: " + s.substring(left,right));
            /********************/

            //s= "sadddbcaqwerb" , t = "abc"
            while (valid == need.size()){
                // 开始缩小窗口，left++
                if(right - left < len){
                    len = right -left;
                    start = left;
                }
                char d = s.charAt(left); // 将要移出窗口的字符d
                left++;
                if(need.containsKey(d)){
                    if(need.get(d).equals(window.get(d))){//原本用==，但一串超长字符串测试失败，改成equals即可，为什么？
                        // 如果相等，还要将d 移出去，那必然不满足了，valid--
                        valid--;
                    }
                    window.put(d, window.get(d)-1);
                }
            }
        }
        //原本这样写报错，case2（s=a,t=a时）下标越界，return len == Integer.MAX_VALUE ? "" : s.substring(start, left+1);
        return len == Integer.MAX_VALUE ? "" : s.substring(start, start+len);
    }

}
